import { Component, OnInit} from '@angular/core';
import { HttpClient } from '@angular/common/http';

interface File {
  name: string;
  lastModified: string;
  size: number;
  message: string;
}

interface DeleteBucketResponse {
  message: string;
}
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  buckets: string[] = [];
  bucketName: string = '';
  files: File[] = [];
  private baseUrl = 'http://localhost:8080'; // Spring Boot 项目的 URL

  constructor(private http: HttpClient) {}

  ngOnInit() {
    this.listBuckets();
    this.getFiles();
  }
  listBuckets() {
    this.http.get<{ buckets: string[] }>('http://localhost:8080/listBuckets').subscribe(response => {
      this.buckets = response.buckets;
    });
  }
  createBucket() {
    this.http.post(`http://localhost:8080/createBucket?bucketName=${this.bucketName}`, {}).subscribe(response => {
      console.log(response);
      this.listBuckets();
    });
  }

  deleteBucket(bucketName: string) {
    this.http.post(`http://localhost:8080/deleteBucket?bucketName=${bucketName}`).subscribe(response => {
      if (response.message === '删除成功') {
        this.buckets = this.buckets.filter(bucket => bucket !== bucketName);
      } else {
        // 处理删除失败的情况
      }
    });
  }


  uploadFile(event: any, bucketName: string) {
    const file = event.target.files[0];
    const formData = new FormData();
    formData.append('file', file);
    formData.append('bucketName', bucketName);

    this.http.post(`${this.baseUrl}/upload`, formData).subscribe(
      data => {
        console.log(data);
      },
      error => {
        console.log(error);
      }
    );
  }

  getFiles() {
    this.http.get<File[]>(`${this.baseUrl}/list`).subscribe(
      data => {
        this.files = data;
      },
      error => {
        console.log(error);
      }
    );
  }

  downloadFile(name: string) {
    this.http.get(`${this.baseUrl}/download/${name}`, { responseType: 'blob' }).subscribe(
      data => {
        const url = window.URL.createObjectURL(data);
        const link = document.createElement('a');
        link.href = url;
        link.download = name;
        link.click();
      },
      error => {
        console.log(error);
      }
    );
  }

  deleteFile(name: string) {
    this.http.delete(`${this.baseUrl}/delete/${name}`).subscribe(
      data => {
        console.log(data);
        this.getFiles(); // 重新获取文件列表
      },
      error => {
        console.log(error);
      }
    );
  }

}
<h2>Create or Delete Bucket</h2>
<input [(ngModel)]="bucketName" type="text" placeholder="Bucket name">
<button (click)="createBucket()">Create Bucket</button>

<h2>Buckets</h2>
<ul>
  <li *ngFor="let bucket of buckets">
    {{ bucket }}
    <input type="file" (change)="uploadFile($event, bucket)" />
    <button (click)="deleteBucket(bucket)">Delete</button>
  </li>
</ul>

<h2>Objects</h2>
<ul>
  <li *ngFor="let file of files">
    {{ file.name }} ({{ file.lastModified }} / {{ file.size }})
    <button (click)="downloadFile(file.name)">Download</button>
    <button (click)="deleteFile(file.name)">Delete</button>
  </li>
</ul>
